import "./app.scss"
import Login from "./component/Login";
import SignUp from "./component/SignUp";
import {Tabs} from "antd";


const tabs =[
{
  key:"login",
  label:"Login",
  children:<Login/>
}
,{
    key:"SignUp",
    label:"SignUp",
    children:<SignUp/>

},
]



 const App = ()=>{
    return(
        <div className="App-container">
        <div className="form-container">
        <Tabs items={tabs}/>
        </div>
        </div>
    )
 }
 export default App;
